"use strict";$(document).ready(function(){$("#select").on("change",function(){$(".loading").show();var e=$("#select").val();$.ajax({method:"get",url:"https://api.nytimes.com/svc/topstories/v2/"+e+".json?api-key=284e1a4e58644ff8b5c13eb355b79961"}).done(function(e){$(".results").empty(),$(".container").addClass("container-height"),$(".logo-container").addClass("styling-container"),$(".logo").addClass("header-styling");var a=e.results.filter(function(e){return e.multimedia.length}).slice(0,12);$.each(a,function(e,a){console.log(a),$(".results").append('<div class="article-wrapper">\n           <a href="'+a.url+'">\n           <div class="article-abstract-wrapper">\n           <div class="article" style="background:url('+a.multimedia[4].url+');background-size:cover;background-position:center">\n           <div class="please"><p class="snippet">'+a.abstract+"</p></div></div>\n        </div>\n        </div></a>")}).fail(function(e){throw e})}),$(".loading").remove()})});